import "../styles/nav.scss";

export default function Nav() {
  return (
    <div className="nav">
      <div className="nav-logo">LTBT</div>
      <div className="nav-items">
        <a>EPISODES</a>
        <a>EVENTS</a>
        <a>ABOUT US</a>
        <a>STORE</a>
        <a>CONTACT US</a>
      </div>
    </div>
  );
}
